import CreateProject from "../app/components/Project/CreateProject";
import EditProject from "../app/components/Project/EditProject";
import IndexProjects from "../app/components/Project/IndexProjects";
import Projects from "../app/views/Projects";

const routes = [
    {
        path: "/",
        exact: true,
        component: Projects,
    },
    {
        path: "/projects",
        exact: true,
        component: IndexProjects,
    },
    {
        path: "/projects/create",
        exact: true,
        component: CreateProject,
    },
    {
        path: "/projects/edit/:id(\\d+)",
        exact: true,
        component: EditProject,
    },  

];

export default routes;
